import React from 'react';
import './App.css';
import MoneyInput from '../src/components/MoneyInput'
import TextInput from '../src/components/TextInput'
import Content from '../src/components/Content'


function App() {

  return (
    <div className="App">
      <h2>Haushaltsbuch</h2>
      <MoneyInput />
      <TextInput />
      <Content />
    </div>
  );
}


export default App;
